let _markdown = "\n\nvCard [#vcard]\n\nLinkDen lets you create a digital business card that visitors can download as a `.vcf` file. The vCard is compatible with all major contact apps on iOS, Android, macOS, and Windows.\n\nEnabling vCard [#enabling-vcard]\n\nToggle the vCard download button in `/admin/settings` under the **vCard** section. When enabled, a download button appears on your public page.\n\nConfiguring vCard Data [#configuring-vcard-data]\n\nThe vCard data is managed through the `vcard.updateConfig` API. Available fields:\n\nPersonal Information [#personal-information]\n\n* **Full Name** -- Your name as it should appear in contacts.\n* **Nickname** -- An optional alternative name or handle.\n* **Birthday** -- Optional birthday field.\n* **Photo** -- Profile photo URL.\n\nProfessional Information [#professional-information]\n\n* **Organization** -- Your company or organization name.\n* **Title** -- Your role or position.\n* **Department** -- Optional department within the organization.\n\nContact Details [#contact-details]\n\n* **Email** -- Personal email address.\n* **Work Email** -- Work email address.\n* **Phone** -- Personal phone number.\n* **Work Phone** -- Work phone number.\n\nAddress [#address]\n\nFull address field for your contact information.\n\nURLs [#urls]\n\nAn array of `{ label, url }` entries for linking to websites, social profiles, or any other URLs.\n\nvCard Format [#vcard-format]\n\nLinkDen generates vCard 3.0 format files, which have the widest compatibility across devices and applications. The generated file includes all fields you have filled in and omits empty fields.\n\nPreview [#preview]\n\nYou can preview the generated `.vcf` output using the `vcard.preview` API procedure, which returns the raw VCard string.\n";
