let _markdown = "\n\nSocial Networks [#social-networks]\n\nLinkDen includes 100+ predefined social network icons from [Simple Icons](https://simpleicons.org/). Social networks are managed separately from blocks at `/admin/social`.\n\nManaging Social Networks [#managing-social-networks]\n\nNavigate to `/admin/social` to see all available social networks. The page lets you:\n\n* **Search** networks by name or slug.\n* **Filter** to show all networks or only active ones.\n* **Toggle** networks on/off with a switch.\n\nActive networks become available for use in **Social Icons** blocks.\n\nUsing Social Icons [#using-social-icons]\n\nOnce you've activated the networks you want:\n\n1. Go to `/admin/builder`.\n2. Click **Add Block** and select **Social Icons**.\n3. The block automatically uses your active social networks.\n4. Configure the display options:\n\n| Option           | Description                              |\n| ---------------- | ---------------------------------------- |\n| Icon size        | Size of each social icon                 |\n| Icon style       | Filled, outlined, or rounded             |\n| Show labels      | Display the network name below each icon |\n| Spacing          | Gap between icons                        |\n| Use brand colors | Use each network's official brand color  |\n\nAvailable Networks [#available-networks]\n\nLinkDen includes icons for all major platforms:\n\n* **Social**: Twitter/X, Instagram, Facebook, TikTok, Snapchat, Threads, Bluesky, Mastodon\n* **Video**: YouTube, Twitch, Vimeo\n* **Music**: Spotify, SoundCloud, Apple Music, Bandcamp\n* **Development**: GitHub, GitLab, Bitbucket, Stack Overflow, CodePen\n* **Professional**: LinkedIn, Dribbble, Behance\n* **Messaging**: Discord, Telegram, WhatsApp, Signal\n* **Gaming**: Steam, Epic Games, PlayStation, Xbox, Nintendo\n* **Other**: Reddit, Pinterest, Medium, Substack, Patreon, Ko-fi, Buy Me a Coffee, and many more\n\nThe full list is automatically updated from the Simple Icons library.\n\nIcon Updates [#icon-updates]\n\nSocial brand icons are sourced from the `@linkden/ui` package. The icon set is checked weekly via a GitHub Actions workflow that detects when new icons are available from Simple Icons.\n";
