let _markdown = "\n\nContact Form [#contact-form]\n\nLinkDen includes an optional contact form that lets visitors send you messages without exposing your email address. Messages are stored in the database and optionally delivered to your inbox via email.\n\nHow It Works [#how-it-works]\n\n1. A visitor fills out the contact form on your public page (name, email, message).\n2. CAPTCHA validates the submission is from a real person (if configured).\n3. The message is saved to your D1 database.\n4. If email is configured, a notification is sent to your address and a confirmation is sent to the visitor.\n5. You can view and manage all submissions in the admin panel at `/admin/contacts`.\n\nEmail Templates [#email-templates]\n\nLinkDen includes two email templates built with React Email:\n\n* **Contact Notification** -- Sent to you (the admin) with the full submission details: name, email, message, and optional fields (subject, phone, company).\n* **Contact Confirmation** -- Sent to the visitor confirming their message was received.\n\nYou can preview these templates in the [Email Templates](/emails) section of this documentation.\n\nSetting Up the Contact Form [#setting-up-the-contact-form]\n\nEnable the Form [#enable-the-form]\n\nToggle the contact form on or off in `/admin/settings` under the **Contact Form** section. Choose the delivery mode:\n\n| Mode               | Description                                               |\n| ------------------ | --------------------------------------------------------- |\n| Database only      | Messages are stored but no emails are sent                |\n| Email notification | Messages are stored and you receive an email notification |\n| Database + email   | Both storage and email notification                       |\n\nConfigure Email (for notifications) [#configure-email-for-notifications]\n\nIn `/admin/settings` under the **Email** section:\n\n1. Select a provider: **Resend** or **Cloudflare Email Workers**.\n2. Enter your API key.\n3. Set the \"From\" email address (must be verified with your provider).\n\nConfigure CAPTCHA (Recommended) [#configure-captcha-recommended]\n\nIn `/admin/settings` under the **CAPTCHA** section, select a provider:\n\nCloudflare Turnstile [#cloudflare-turnstile]\n\nPrivacy-friendly, invisible challenge from Cloudflare.\n\n1. Go to **Turnstile** in the Cloudflare dashboard.\n2. Add your site and get the site key and secret key.\n3. Enter both keys in the CAPTCHA settings.\n\nGoogle reCAPTCHA [#google-recaptcha]\n\nTraditional checkbox CAPTCHA from Google.\n\n1. Register your site at [google.com/recaptcha](https://www.google.com/recaptcha).\n2. Get the site key and secret key.\n3. Enter both keys in the CAPTCHA settings.\n\nWithout any CAPTCHA configured, the form works but has no bot protection.\n\nManaging Submissions [#managing-submissions]\n\nNavigate to `/admin/contacts` to view all form submissions. Each submission shows:\n\n* Sender name and email.\n* Message content.\n* Submission date and time.\n* Read/unread status.\n\nAvailable actions:\n\n* **Mark as read** / **Mark as unread** -- Toggle the read status.\n* **Delete** -- Permanently remove a submission.\n\nThe dashboard at `/admin` shows an **Unread Contacts** stat card with a direct link to the contacts page.\n\nForm Fields [#form-fields]\n\nThe contact form includes:\n\n| Field   | Type                  | Required      |\n| ------- | --------------------- | ------------- |\n| Name    | Text                  | Yes           |\n| Email   | Email                 | Yes           |\n| Message | Textarea              | Yes           |\n| CAPTCHA | Turnstile / reCAPTCHA | If configured |\n";
