let _markdown = "\n\nBlocks [#blocks]\n\nLinkDen supports 5 block types that appear on your public page in the order you arrange them. All blocks are managed from the block builder at `/admin/builder`.\n\nBlock Builder Layout [#block-builder-layout]\n\nThe builder uses a two-panel layout:\n\n* **Left panel** -- Your block list with an \"Add Block\" dropdown button.\n* **Right panel** -- A live phone preview (visible on `lg` screens and above). On mobile, a floating action button opens the preview in a modal overlay.\n\nBlock Types [#block-types]\n\nLink [#link]\n\nThe most common block type. A clickable button that takes visitors to an external URL.\n\n* **Title** -- The text displayed on the button.\n* **URL** -- The destination URL.\n* **Icon** -- Optional icon identifier.\n* **Config options**: emoji, emoji position, icon slug, icon position, text alignment, font weight, outlined style, open in new tab.\n\nHeader [#header]\n\nA text heading that visually separates groups of blocks. Useful for organizing content into categories.\n\n* **Title** -- The heading text.\n* **Config options**: heading level (h1-h6), text alignment, font weight, emoji, emoji position, show divider line.\n\nSocial Icons [#social-icons]\n\nA row of social media icon links. Uses the social networks you have activated in `/admin/social`. See [Social Networks](/docs/guide/social-networks) for setup.\n\n* **Config options**: icon size, icon style (filled, outlined, rounded), show labels, spacing, use brand colors.\n\nEmbed [#embed]\n\nEmbed content from external platforms directly on your page.\n\n* **Embed Type** -- YouTube, Spotify, SoundCloud, or Custom.\n* **Embed URL** -- The source URL to embed.\n* **Config options**: aspect ratio, max width, show title.\n\nContact Form [#contact-form]\n\nAn inline contact form for visitors to send you messages.\n\n* **Config options**: button text, button emoji, button emoji position, success message.\n\nThe contact form requires configuration in `/admin/settings` (Contact Form and optionally CAPTCHA sections). See [Contact Form](/docs/guide/contact-form) for details.\n\nAdding a Block [#adding-a-block]\n\n1. Open the block builder at `/admin/builder`.\n2. Click **Add Block** to open the dropdown menu.\n3. Select a block type.\n4. The block is added and the edit panel opens.\n\nBlock Edit Panel [#block-edit-panel]\n\nClicking edit on any block opens a slide-in panel from the right with 4 tabs:\n\nContent Tab [#content-tab]\n\nFields vary by block type:\n\n* **Link**: Title, URL\n* **Embed**: Title, embed type (YouTube, Spotify, SoundCloud, Custom), embed URL\n* **Social Icons**: Title, social icons JSON\n* **Header** / **Contact Form**: Title\n\nStyle Tab [#style-tab]\n\n* Icon name input\n* Config JSON textarea for advanced configuration\n\nOptions Tab [#options-tab]\n\nReference text listing common config keys: `noFollow`, `newTab`, `animation`, `thumbnail`.\n\nSchedule Tab [#schedule-tab]\n\n* Start date/time (`datetime-local` input)\n* End date/time (`datetime-local` input)\n* **Clear schedule** button\n\nBlocks outside their scheduled window are automatically hidden from the public page.\n\nBlock Configuration [#block-configuration]\n\nAll block types share a base configuration with these style options:\n\n| Option                  | Description                       |\n| ----------------------- | --------------------------------- |\n| Color variant           | Preset color scheme for the block |\n| Custom background color | Override background color         |\n| Custom text color       | Override text color               |\n| Custom border color     | Override border color             |\n| Border radius           | Corner rounding                   |\n| Border width            | Border thickness                  |\n| Shadow                  | Drop shadow effect                |\n| Animation               | Hover or entrance animation       |\n| Padding                 | Inner spacing                     |\n\nReordering Blocks [#reordering-blocks]\n\nDrag any block by its grip handle in the block list. The new order is saved immediately via the `blocks.reorder` mutation.\n\nToggling Visibility [#toggling-visibility]\n\nClick the eye icon to toggle a block's visibility. Hidden blocks remain in your list but are not shown on the public page. This is useful for:\n\n* Temporarily removing a block without deleting it.\n* Preparing blocks in advance and enabling them later.\n* Time-limited or seasonal content (or use scheduling instead).\n\nDeleting a Block [#deleting-a-block]\n\nClick the trash icon on any block to delete it. Deletions are permanent.\n\nScheduling [#scheduling]\n\nBlocks support scheduled visibility with start and end dates. A block outside its scheduled window is automatically hidden from the public page. Configure scheduling in the **Schedule** tab of the block edit panel.\n\nPhone Preview [#phone-preview]\n\nThe right panel shows a phone-frame preview (280px wide) with:\n\n* A light/dark mode toggle button.\n* Only `isEnabled: true` blocks rendered.\n* Type-specific preview rendering:\n  * **Link**: Button-style bar\n  * **Header**: Centered bold text\n  * **Social Icons**: Placeholder circles\n  * **Embed**: Gray box with embed type label\n  * **Contact Form**: Stacked input placeholders\n* Empty state message when no enabled blocks exist.\n";
