let _markdown = "\n\nAppearance [#appearance]\n\nThe appearance page at `/admin/appearance` controls everything visual about your public link page. All changes use a preview-first workflow -- you can see the effect of each change in the live phone preview before publishing.\n\nPreview-First Workflow [#preview-first-workflow]\n\nThe Appearance page uses a **Publish / Discard** model:\n\n1. Make changes to any setting (theme, colors, banner, etc.).\n2. See changes reflected instantly in the phone preview on the right.\n3. Click **Publish** to save all changes at once, or **Discard** to revert.\n\nThe subtitle shows \"Unsaved changes -- publish to go live\" when you have pending changes, and \"Your page is up to date\" when everything is saved.\n\n***\n\nTheme Presets [#theme-presets]\n\nChoose from 7 built-in themes, each available in dark and light variants (14 total). An auto mode follows the visitor's system preference.\n\nAvailable Themes [#available-themes]\n\n| Theme                 | Color              | Style                                |\n| --------------------- | ------------------ | ------------------------------------ |\n| **Default**           | Cyan (`#0FACED`)   | Clean, modern, medium border radius  |\n| **Corporate Classic** | Navy (`#1E3A5F`)   | Professional, subtle border radius   |\n| **Corporate Modern**  | Teal (`#0D9488`)   | Contemporary, balanced border radius |\n| **Hacker Terminal**   | Green (`#16A34A`)  | Monospace-inspired, no border radius |\n| **Neon Cyber**        | Purple (`#7C3AED`) | Eye-catching, large border radius    |\n| **Furry Pastel**      | Pink (`#EC4899`)   | Warm, fully rounded corners          |\n| **Furry Bold**        | Orange (`#EA580C`) | High energy, large border radius     |\n\nClick any theme to select it. The color pickers update automatically to match the theme's palette.\n\nColor Customization [#color-customization]\n\nOverride individual theme colors:\n\n* **Primary color** -- The main accent color used for buttons and interactive elements.\n* **Secondary color** -- Supporting color for secondary elements.\n* **Accent color** -- Highlight color for emphasis.\n* **Background color** -- Override the page background.\n\nColors are set via CSS custom properties (`--ld-primary`, `--ld-secondary`, etc.) and apply on top of the selected theme preset.\n\nDefault Color Mode [#default-color-mode]\n\nSet the default color mode for visitors:\n\n* **Light** -- Forces the light variant.\n* **Dark** -- Forces the dark variant.\n* **System** -- Follows the visitor's OS preference.\n\nVisitors can always toggle between light and dark mode using the theme toggle button on the public page.\n\nBanner [#banner]\n\nToggle a gradient banner that displays behind your avatar on the public page. When enabled, choose from themed banner presets that automatically adapt to your selected theme colors.\n\nThe banner appears as a gradient strip at the top of your page, giving your profile a more distinctive look.\n\nVerified Badge [#verified-badge]\n\nToggle a blue checkmark badge that appears next to your display name on the public page. This is purely cosmetic and does not require any external verification.\n\nBranding [#branding]\n\nControl the whitelabel footer on your public page:\n\n* **Show whitelabel footer** -- Toggle the footer on/off.\n* **Custom Text** -- Replace the default \"Powered by LinkDen\" text.\n* **Custom Link** -- Set a custom URL for the footer link.\n\nWhen disabled, no footer is shown at all. LinkDen is MIT licensed, so no attribution is required.\n\nCustom CSS [#custom-css]\n\nFor advanced customization, add custom CSS that is injected into your public page. This lets you override any theme variable or style, add animations, or implement completely unique designs.\n\nAvailable CSS Classes [#available-css-classes]\n\n| Class               | Element                |\n| ------------------- | ---------------------- |\n| `.ld-page`          | Page container         |\n| `.ld-profile`       | Profile/header section |\n| `.ld-avatar`        | Profile avatar         |\n| `.ld-bio`           | Bio text               |\n| `.ld-blocks`        | Blocks container       |\n| `.ld-link-block`    | Link buttons           |\n| `.ld-header-block`  | Header/divider blocks  |\n| `.ld-social-block`  | Social icons row       |\n| `.ld-embed-block`   | Embed blocks           |\n| `.ld-contact-block` | Contact form           |\n| `.ld-footer`        | Branding footer        |\n\nCSS Variables [#css-variables]\n\n| Variable                | Description                 |\n| ----------------------- | --------------------------- |\n| `--ld-primary`          | Primary accent color        |\n| `--ld-secondary`        | Secondary color             |\n| `--ld-accent`           | Accent color for highlights |\n| `--ld-action`           | Action/button color         |\n| `--ld-background`       | Page background             |\n| `--ld-foreground`       | Main text color             |\n| `--ld-card`             | Card background             |\n| `--ld-card-foreground`  | Card text color             |\n| `--ld-border`           | Border color                |\n| `--ld-muted`            | Muted background            |\n| `--ld-muted-foreground` | Muted text color            |\n| `--ld-radius`           | Border radius               |\n\nExample [#example]\n\n```css\n/* Round all link blocks */\n.ld-link-block {\n  border-radius: 20px;\n}\n\n/* Custom gradient background */\n.ld-page {\n  background: linear-gradient(135deg, var(--ld-primary), var(--ld-accent));\n}\n```\n\nDark / Light Mode Toggle [#dark--light-mode-toggle]\n\nVisitors to your public page can switch between dark and light mode using the theme toggle button. The initial mode is determined by:\n\n1. The visitor's saved preference (stored in `localStorage`).\n2. Your site's default color mode setting.\n3. The visitor's OS-level color scheme preference if \"system\" is selected.\n";
