let _markdown = "\n\nAnalytics [#analytics]\n\nLinkDen includes a built-in analytics dashboard at `/admin/analytics` that tracks visitor activity without relying on third-party services.\n\nDashboard [#dashboard]\n\nPeriod Selector [#period-selector]\n\nFilter all analytics data by time period:\n\n* **7 days** (default)\n* **30 days**\n* **90 days**\n\nAll queries re-run when the period changes.\n\nStat Cards [#stat-cards]\n\nTwo summary cards displayed in a 2-column grid:\n\n| Card         | Icon                      | Description                         |\n| ------------ | ------------------------- | ----------------------------------- |\n| Total Views  | Eye (blue)                | Page views for the selected period  |\n| Total Clicks | MousePointerClick (green) | Link clicks for the selected period |\n\nViews Over Time [#views-over-time]\n\nA bar chart showing daily page views for the selected period. Bars highlight on hover and show the count. Date labels display month and day (e.g., \"Feb 23\").\n\nBottom Grid [#bottom-grid]\n\nThree cards in a 3-column layout (stacks to 1 column on mobile):\n\n| Card          | Description                                             | Limit  |\n| ------------- | ------------------------------------------------------- | ------ |\n| **Top Links** | Block title, URL, and click count ranked by clicks      | Top 10 |\n| **Referrers** | Referrer domain and count (\"Direct\" for null referrers) | Top 10 |\n| **Countries** | Country name and visit count                            | Top 20 |\n\nWhat is Tracked [#what-is-tracked]\n\nPage Views [#page-views]\n\nEvery visit to your public link page is recorded with:\n\n* Timestamp\n* Referrer URL\n* User agent\n* Country (from Cloudflare `CF-IPCountry` header)\n\nLink Clicks [#link-clicks]\n\nEvery click on a link block is tracked with:\n\n* Block ID\n* Referrer URL\n* User agent\n* Country\n\nPrivacy [#privacy]\n\nLinkDen's analytics are privacy-focused:\n\n* **No cookies** are set for tracking.\n* **No IP addresses** are stored. Country data comes from the Cloudflare header.\n* **No third-party scripts** are loaded on the public page.\n* **No fingerprinting** techniques are used.\n* Data is stored in your own D1 database, not sent to any external service.\n\nDashboard on Home Page [#dashboard-on-home-page]\n\nThe admin dashboard at `/admin` also shows a mini bar chart with views over the last 7 days, plus 3 stat cards (total views, total clicks, unread contacts). The full analytics page provides more detailed breakdowns.\n\nData Retention [#data-retention]\n\nAnalytics data is stored indefinitely in your D1 database. Use the export feature in settings to back up data if needed.\n";
